import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <main>
        <Container>
          <Row>
            <Col>
              <h1>Bienvenu</h1>
            </Col>
          </Row>
        </Container>
      </main>
    </div>
  );
}

export default App;
